import React, {useContext, useEffect, useState} from 'react';
import styles from './canvas.module.scss'
import CanvasDraw from "react-canvas-draw";
import mergeImages from "merge-images";

import backIcon from './img/back_arrow.svg'
import pink from './img/pink.svg'
import yellow from './img/yellow.svg'
import green from './img/green.svg'
import blue from './img/blue.svg'
import purple from './img/purple.svg'
import beige from './img/beige.svg'
import gray from './img/gray.svg'
import white from './img/white.svg'
import black from './img/black.svg'

import pencilIcon from './img/pencil.svg'
import brushIcon from './img/brush.svg'
import bucketIcon from './img/bucket.svg'
import sizeIcon from './img/size.svg'
import useHandleNFTForm from "../../hooks/useHandleNFTForm";
import {Context} from "../../store";
import {Link, useNavigate} from "react-router-dom";
import {pathList} from "../../routes/path";
import {localStorageGet} from "../../utils/localStorage";

const Canvas = () => {
    const [{user, currentDrawl}, ACTION] = useContext(Context);

    const COLORS = [
        {
            color: "#FF99F8",
            icon: pink
        },
        {
            color: "#FFEE00",
            icon: yellow
        },
        {
            color: "#86FA16",
            icon: green
        },
        {
            color: "#6FFFF6",
            icon: blue
        },
        {
            color: "#B38FFF",
            icon: purple
        },
        {
            color: "#FFAE4F",
            icon: beige
        },
        {
            color: "#979797",
            icon: gray
        },
        {
            color: "#ffffff",
            icon: white
        },
        {
            color: "#000000",
            icon: black
        },
    ]
    const WATERMARK = "data:image/png;base64,"

    const navigate = useNavigate()
    const handleNFTForm = useHandleNFTForm({
        item: currentDrawl,
        callback: () => {
            ACTION.SET_CURRENT_DRAWL(null);
            ACTION.SET_IS_LOADER(false);
            navigate(pathList.studio.path);
        }
    })

    const [selectedColor, setSelectedColor] = useState(COLORS[0])
    const [selectedTool, setSelectedTool] = useState("pencil")
    const [modify, setModify] = useState(null)
    const [isDrawing, setIsDrawing] = useState(null)
    const [isChangingSizeOpen, setIsChangingSizeOpen] = useState(false)
    const [sizeValue, setSizeValue] = useState(5)
    const [canvasBgImage, setCanvasBgImage] = useState(WATERMARK)

    useEffect(() => {
        if (modify) {
            const canvas = modify.canvas.interface

            const onMouseDown = () => setIsDrawing(true)
            const onMouseUp = () => setIsDrawing(false)
            const fillCanvas = () => {
                if (selectedTool === "bucket") {
                    const drawCanvas = modify.ctx.drawing
                    drawCanvas.rect(0, 0, 10000, 10000)

                    drawCanvas.fillStyle = selectedColor.color;
                    drawCanvas.fillRect(0, 0, 10000, 10000);

                }
            }

            canvas.addEventListener("mousedown", onMouseDown)
            canvas.addEventListener("mouseup", onMouseUp)
            canvas.addEventListener("mouseleave", onMouseUp)
            canvas.addEventListener("mousedown", fillCanvas)

            return () => {
                canvas.removeEventListener("mousedown", onMouseDown)
                canvas.removeEventListener("mouseup", onMouseUp)
                canvas.removeEventListener("mouseleave", onMouseUp)
                canvas.removeEventListener("mousedown", fillCanvas)
            }
        }
    }, [modify, selectedColor, selectedTool])

    useEffect(() => {
        if (currentDrawl) setCanvasBgImage(currentDrawl.image)
    }, [currentDrawl])

    const changeColor = color => {
        setSelectedColor(color)
        closeChangingSize()
    }

    const changeSelectedTool = (tool) => {
        setSelectedTool(tool)
        closeChangingSize()
    }

    const changeSize = event => setSizeValue(event.target.value)

    const closeChangingSize = () => setIsChangingSizeOpen(false)

    const getDrawnImage = async () => {
        ACTION.SET_IS_LOADER(true);
        const bgCanvas = document.createElement("canvas")
        bgCanvas.width = modify.canvas.drawing.width
        bgCanvas.height = modify.canvas.drawing.height

        const bgCanvasCtx = bgCanvas.getContext("2d")
        bgCanvasCtx.fillStyle = "#fff"
        bgCanvasCtx.fillRect(0, 0, bgCanvas.width, bgCanvas.height)

        const canvasList = document.querySelectorAll("canvas")

        const imageList = [
            canvasList[0].toDataURL("image/png"),
            canvasList[1].toDataURL("image/png"),
            canvasList[2].toDataURL("image/png"),
        ]

        const base64Image = await mergeImages([bgCanvas.toDataURL("image/png"), ...imageList]).then(b64 => b64);

        const res = await fetch(base64Image);
        const blob = await res.blob();
        const file = new File([blob], "img", { type: "image/png" });


        if (currentDrawl) {
            await handleNFTForm.onPhotoUpdate(file)
        } else {
            await handleNFTForm.onItemCreate(file)
        }

    }

    const canvasUndo = () => modify.undo()
    const canvasRestart = () => modify.clear()


    useEffect(() => {
        const token = localStorageGet("token", null)
        if (!token) navigate("/")
    }, [user])

    return (
        <div className={styles.canvas_page}>
            <div className={styles.container}>
                <Link to={pathList.studio.path} className={styles.canvas_page_back_btn}>
                    <img src={backIcon} alt=""/>
                    <span>All canvases</span>
                </Link>
                <div className={styles.canvas_wrap}>
                    <div className={styles.canvas}>
                        <div className={`${styles.canvas_colors} ${isDrawing ? styles.hidden : ""}`}>
                            {
                                COLORS.map((cl, idx) => {
                                    return (
                                        <div className={`${styles.canvas_colors_item} ${selectedColor.color === cl.color ? styles.active : ""}`}
                                             onClick={() => changeColor(cl)}
                                             key={idx}
                                        >
                                            <img src={cl.icon} alt=""/>
                                        </div>
                                    )
                                })
                            }
                        </div>
                        <CanvasDraw
                            ref={(container) => {
                                setModify(container)
                            }}
                            imgSrc={canvasBgImage}
                            hideGrid={true}
                            canvasWidth={1200}
                            canvasHeight={700}
                            brushColor={selectedTool === "pencil" ? `${selectedColor.color}7f` : selectedColor.color}
                            catenaryColor={selectedTool === "pencil" ? `${selectedColor.color}00` : selectedColor.color}
                            lazyRadius={0}
                            immediateLoading={false}
                            brushRadius={sizeValue}
                        />
                    </div>
                    <div className={styles.canvas_bottom}>
                        <div className={styles.canvas_bottom_empty}/>
                        <div className={styles.canvas_controls}>
                            <div className={selectedTool === "pencil" ? styles.active : ""}
                                 onClick={() => changeSelectedTool("pencil")}
                            >
                                <img src={pencilIcon} alt=""/>
                            </div>
                            <div
                                onClick={() => setIsChangingSizeOpen(!isChangingSizeOpen)}
                            >
                                <img src={sizeIcon} alt=""/>
                            </div>
                            <div className={selectedTool === "brush" ? styles.active : ""}
                                 onClick={() => changeSelectedTool("brush")}
                            >
                                <img src={brushIcon} alt=""/>
                            </div>
                            <div className={selectedTool === "bucket" ? styles.active : ""}
                                onClick={() => changeSelectedTool("bucket")}
                            >
                                <img src={bucketIcon} alt=""/>
                            </div>
                            {
                                isChangingSizeOpen &&
                                <div className={styles.canvas_change_size}>
                                    <label
                                        htmlFor='range'
                                        className={styles.range_value}
                                        style={{ left: `${sizeValue * 2}%`, transform: `translate(${-sizeValue * 2}%, 0)` }}>{sizeValue}</label>
                                    <input
                                        id='range'
                                        value={sizeValue}
                                        className={styles.input}
                                        type='range'
                                        step={1}
                                        min={2}
                                        max={50}
                                        onChange={(e) => changeSize(e)}
                                    />
                                </div>
                            }
                        </div>
                        <div className={styles.canvas_buttons}>
                            <div className={styles.canvas_buttons_clear}>
                                <div onClick={canvasUndo}>UNDO</div>
                                <div onClick={canvasRestart}>RESTART</div>
                            </div>
                            <div
                                onClick={getDrawnImage}
                                className={styles.canvas_mint_btn}>
                                {currentDrawl ? "Exhibit" : "Mint"}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Canvas;